webpackJsonp([0xa3e2de0969fc],{562:function(e,t){e.exports={data:{file:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:.9657118055555556,src:"/static/avatar-820706df6fdb07a9b021a790449fec17-381d6.jpg",srcSet:"/static/avatar-820706df6fdb07a9b021a790449fec17-62f05.jpg 200w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-dc2b4.jpg 400w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-381d6.jpg 800w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-e5d70.jpg 1200w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-d14e0.jpg 1600w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-9cc71.jpg 2225w",srcWebp:"/static/avatar-820706df6fdb07a9b021a790449fec17-fefde.webp",srcSetWebp:"/static/avatar-820706df6fdb07a9b021a790449fec17-5eed2.webp 200w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-68e3c.webp 400w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-fefde.webp 800w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-300fe.webp 1200w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-ed5bd.webp 1600w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-9442a.webp 2225w",sizes:"(max-width: 800px) 100vw, 800px"}}},site:{siteMetadata:{title:"Kostas Bariotis' Blog",description:"I am Kostas Bariotis, a web developer, a proud wanderer and a passionate doer. My mission is to write clean and efficient code, to solve problems on the web and to learn something more.",siteUrl:"https://kostasbariotis.com"}},markdownRemark:{html:"",excerpt:"",frontmatter:{date:"June 11, 2015",path:"/drafts/secrets-of-mongo-shell/",tags:null,title:"Secrets of Mongo Shell",draft:!0}}},pathContext:{prev:{excerpt:"A few days ago I stumbled upon this wonderful  story . I love those short stories. They are real, inspirational and educational stories. I've also have two stories on my head that I kept saying when I am among fellows but I never wrote them somewhereâ€¦",html:'<p>A few days ago I stumbled upon this wonderful <a href="http://cs.txstate.edu/~br02/cs1428/ShortStoryForEngineers.htm" target="_blank" rel="noreferrer noopener">story</a>. I love those short stories. They are real, inspirational and educational stories.</p>\n<p>I\'ve also have two stories on my head that I kept saying when I am among fellows but I never wrote them somewhere. Here\'s my chance. Those stories are not mine but I have them in my mind for so long that I can\'t even remember where I read them. If you have any clue please share with me, in order to give credits to the original authors.</p>\n<p>Here\'s the first one.</p>\n<blockquote>\n<p>A train\'s engine got broken while in the road. It was recently purchaced and it was it\'s first trip and the president of the transportation company was on it. It happen also to be on, an engineer that was specialized on those kinds of engines. So the president headed to him and asked for help. He was desparate, afraid of the passengers to not left pleased. The engineer agreed to fix the engine and asked for 10.000$. The president took the deal even though the price was insane. The engineer headed to the front of the train. Picked up a hammer that was nearby and started looking at the engine. Everyone was waiting and suddenly he makes three hits to three different spots. Big hits. He yield to the driver to turn on the engine and for everyone\'s surprise the engine was running again. He fixed it. But the president was mad. He turned to the enginneer and said "You charded me 10.000$ just to take three hits with the hammer? I would done it my self!". And the engineer responded "I didn\'t charged you for the hitting. I charged you because I knew... where to hit."</p>\n</blockquote>\n<p>Amazing. I am always carrying this story in my head. In fact, this story drove me where I am today, always trying to learn things that few people only know. I hope it inspires you too.</p>\n<p>And here\'s the second.</p>\n<blockquote>\n<p>A young junior employee on an private investements company did a serious, very critical mistake, that cost the company 1.000.000$. The man very sad, the next day went to his manager office and he handed his resignation. He said to him "I know you probably going to fire me for the mistake I\'ve done so I am quiting.". And the manager said: "Are you being serious? I just spend a million on your training. You aren\'t going anywhere!".</p>\n</blockquote>\n<p>Loved this story too. Experience is so important. It\'s  what defines you as a professional. But in order to gain it you need to act. Without fear.</p>\n<p>And again, these stories are not mine and if you happen to know the original authors please share them with me.</p>\n<p>Do you know any good stories?</p>',id:"/home/travis/build/kbariotis/kostasbariotis.com/blog/the-stories-in-my-head/index.md absPath of file >>> MarkdownRemark",timeToRead:2,frontmatter:{date:"2015-06-13T13:46:56.000Z",path:"/the-stories-in-my-head/",tags:"engineers, experience, stories",title:"The stories in my head",draft:null}},next:{excerpt:"https://arukas.io/en/ \n https://zeit.co/now \n http://www.evennode.com/ \n http://surge.sh/ \n https://www.nodechef.com",html:'<p><a href="https://arukas.io/en/" target="_blank" rel="noreferrer noopener">https://arukas.io/en/</a>\n<a href="https://zeit.co/now" target="_blank" rel="noreferrer noopener">https://zeit.co/now</a>\n<a href="http://www.evennode.com/" target="_blank" rel="noreferrer noopener">http://www.evennode.com/</a>\n<a href="http://surge.sh/" target="_blank" rel="noreferrer noopener">http://surge.sh/</a>\n<a href="https://www.nodechef.com" target="_blank" rel="noreferrer noopener">https://www.nodechef.com</a></p>',id:"/home/travis/build/kbariotis/kostasbariotis.com/blog/nodejs-hosting/index.md absPath of file >>> MarkdownRemark",timeToRead:1,frontmatter:{date:"2015-05-23T00:00:00.000Z",path:"/drafts/nodejs-hosting/",tags:null,title:"Nodejs hosting",draft:!0}}}}}});
